import React, { Component } from 'react';
import Axios from 'axios';
import './App.css';

class App extends Component {
  state={
    countries:[]
  }
  componentDidMount(){
    this.getData();
  }
  async getData(){
    const res=await Axios.get("https://pomber.github.io/covid19/timeseries.json");
    this.setState({
      countries:res
    })
    console.log(res);
  }
  render(){
    return (
      this.statecountries['Afghanistan'].map((dates,i)=>
        <li key={i}>{dates.date}</li>
        )
      );
  }
}

export default App;
